from time import ctime
from timeit import Timer
from math import sqrt

def getNonNegativeInt(prompt):
    while True:
        try:
            user_input = input(prompt)
            if user_input == "":
                raise ValueError("Missing input")
            value = eval(user_input)
            if not isinstance(value, int):
                raise ValueError(f"{user_input} is not an integer")
            if value < 0:
                raise ValueError(f"{value} must not be negative")
            return value
        except Exception as e:
            print(f"Invalid input: {e}")

def computeXcoordinates(width, intervals):
    return [-width / 2 + i * (width / intervals) for i in range(intervals + 1)]

def computeYcoordinates(xCoords):
    y1 = [sqrt(1 - (abs(x) - 1)**2) for x in xCoords]
    y2 = [-3 * sqrt(1 - sqrt(abs(x) / 2)) for x in xCoords]
    return y1, y2

def computeArea(intervals, width):
    xCoords = computeXcoordinates(width, intervals)
    y1, y2 = computeYcoordinates(xCoords)

    area = 0
    for i in range(intervals):
        area += (y1[i] + y1[i + 1]) * (xCoords[i + 1] - xCoords[i]) / 2
        area += (y2[i] + y2[i + 1]) * (xCoords[i + 1] - xCoords[i]) / 2

    return area

def displayTerminationMessage():
    print("""
        Programmed by Shafin
        Date: %s
        End of processing.""" % ctime())

def main():
    heart_width = 4

    while True:
        intervals = getNonNegativeInt("Enter the number of intervals (0 to exit): ")
        if intervals == 0:
            displayTerminationMessage()
            break
        
        calculated_area = computeArea(intervals, heart_width)
        print(f"Approximate area of the heart: {calculated_area:.14e}")
        t = Timer(lambda: computeArea(intervals, heart_width))
        time_taken = t.timeit(number=1)

        print(f"Time taken for {intervals} intervals: {time_taken:.6e} seconds")

if __name__ == "__main__":
    main()

#include <vector>
#include <iostream>
