using System.Linq;

namespace Test
{
    using System;
    using System.Collections.Generic;

    internal abstract class Program
    {
        private static int LongestSubstringLength(int m, int k, string colors)
        {
            var left = 0;
            var right = 0;
            var maxLength = 0;
            var colorCounts = new Dictionary<char, int>();

            while (right < m)
            {
                var color = colors[right];

                if (!colorCounts.ContainsKey(color))
                    colorCounts[color] = 0;

                colorCounts[color]++;

                while (right - left + 1 - MaxValue(colorCounts) > k)
                {
                    colorCounts[colors[left]]--;
                    if (colorCounts[colors[left]] == 0)
                        colorCounts.Remove(colors[left]);
                    left++;
                }

                maxLength = Math.Max(maxLength, right - left + 1);
                right++;
            }

            return maxLength;
        }

        private static int MaxValue(Dictionary<char, int> dictionary)
        {
            return dictionary.Values.Prepend(int.MinValue).Max();
        }

        private static void Main()
        {
            const int m = 7; // 3
            const int k = 2; // 0
            const string colors = "BRGBBRR";

            var result = LongestSubstringLength(m, k, colors);
            Console.WriteLine(result);
        }
    }
}

