    public function add()
    {
        $item = $this->Items->newEmptyEntity();
        if ($this->request->is('post')) {
            $files = $this->request->getUploadedFiles();
            $files['picture']->getStream();
            $files['picture']->getSize();
            $files['picture']->getClientFileName();
            
            //memberi nama file untuk disimpan di database//
            $myname = $this->request->getData()['picture']->getClientFileName();
            //mengambil nama ekstensi file//
            $myext = substr(strchr($myname, "."), 1);

            $mypath = "upload/" . $myname . "." . $myext;
            $item = $this->Items->patchEntity($item, $this->request->getData());
            $item->picture = $myname . "." . $myext;
            //memindahkan file ke folder webroot/upload
            $files['picture']->moveTo(WWW_ROOT . $mypath);

            if ($this->Items->save($item)) {
                $this->Flash->success(__('The item has been saved.'));

                return $this->redirect(['action' => 'index']);
            }
            $this->Flash->error(__('The item could not be saved. Please, try again.'));
        }
        $types = $this->Items->Types->find('list', limit: 200)->all();
        $this->set(compact('item', 'types'));
    }

